let o = parcel.getFeatureById('nought')
let x = parcel.getFeatureById('cross')

let clones = []
let nought = true

feature.on('click', e => {
  if (clones.length === 9) {
    clones.forEach(c => c.remove())
    clones = []
  }

  let c = (nought ? o : x).clone()
  c.position.copyFrom(e.point)
  clones.push(c)

  nought = !nought
})

let win1 = parcel.getFeatureById('spark1')
let win2 = parcel.getFeatureById('spark2')
let door = parcel.getFeatureById('gift')
var correct = [1,2,3,5] // your code

let txt = parcel.getFeatureById('correcttxt') //Sign that displays the result

/* ---------------- */

