function arraysEqual(arr1,arr2){
  i=arr1.length
  for(i;i--;){
    if(arr1[i] != arr2[i]){
      return false;
    }
  }
  return true;
}

function reset(){
  code=[0,0,0,0]
}

feature.on('click', e=>{
  if(arraysEqual(correct,code)){
    door.rotation.y=55
    win1.scale.x = 6.8
    win1.scale.y = 7.2
    win1.position.y = 24.25
    win2.scale.x = 6.8
    win2.scale.y = 7.2
    win2.position.y = 24.25

  }else{
    door.rotation.y=0

    reset()
  }

})

let ball, paddle, frame, blocks

feature.on('keys', e => {
  if (e.keys.left) {
    paddle.moveLeft()
 }else if (e.keys.right) {
    paddle.moveRight()
  }
})

feature.on('start', e => {
  reset()
})

feature.on('frame', e => {
  frame += 1
  update()
  draw()
})

function update() {
  ball.update()
}

function draw() {
  feature.screen.fill(0)

  ball.draw()
  paddle.draw()
  for (j = 0; j < blocks.length; j ++) {
    blocks[j].draw()
  }
}

function reset() {
  ball = new Ball(Math.round(Math.random() * 64), 32)
  paddle = new Paddle(29, 60, 6)
  frame = 0
  blocks = []
  for (y = 0; y < 5; y ++) {
    for (z = 0; z < 8; z ++) {
      blocks.push(new Block(Math.floor(feature.screenWidth / 8 * z + 2), y * 4 + 2, 5, 3))
    }
  }
  draw()
}

// classes

class Ball {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y

    this.xVel = Math.random() > 0.5 ? 1 : -1
    this.yVel = 1
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    // wall collision detection

    if (this.xPos + this.xVel > 63 || this.xPos + this.xVel < 0) {
      this.xVel *= -1
    }
    if (this.yPos + this.yVel < 0) {
      this.yVel *= -1
    }
    if (this.yPos + this.yVel > 63) {
      reset()
    }

    // paddle collision detection

    if ((this.yPos + this.yVel == paddle.yPos)) {
      let nextX = this.xPos + this.xVel
      if (nextX >= paddle.xPos && nextX <= paddle.xPos + paddle.width) {
        this.yVel *= -1
      }
    }

    // block collision detection

    for (let i = 0; i < blocks.length; i ++) {
      let block = blocks[i]
      let nextX = this.xPos + this.xVel
      let nextY = this.yPos + this.yVel

      if (nextX >= block.x && nextX < block.x + block.width && nextY >= block.y && nextY < block.y + block.height) {
        if (this.xPos < block.x || this.xPos > block.x + block.width - 1) {
          this.xVel *= -1
        }
        if (this.yPos < block.y || this.yPos > block.y + block.height - 1) {
          this.yVel *= -1
        }

        blocks.splice(i, 1)
        break
      }
    }

    // update position

    this.xPos += this.xVel
    this.yPos += this.yVel
  }

  draw() {
    for (let i = 0; i < 3; i ++) {
      feature.screen[this.yPos * feature.screenWidth * 3 + this.xPos * 3 + i] = 255
    }
  }
}

class Paddle {
  constructor(x, y, w) {
    this.xPos = x
    this.yPos = y
    this.width = w
  }

  draw() {
    for (let i = this.yPos * feature.screenWidth * 3 + this.xPos * 3; i < this.yPos * feature.screenWidth * 3 + (this.xPos + this.width) * 3 + 3; i ++) {
      feature.screen[i] = 255
    }
  }

  moveLeft() {
    if (this.xPos > 0) {
      this.xPos -= 1
      draw()
    }
  }

  moveRight() {
    if (this.xPos + this.width < 63) {
      this.xPos += 1
      draw()
    }
  }
}

class Block {
  constructor(x, y, w, h) {
    this.x = x
    this.y = y
    this.width = w
    this.height = h
  }

  draw() {
    // horizontal lines
    for (let i = 0; i < this.width; i++) {
      feature.screen[this.y * feature.screenWidth * 3 + (this.x + i) * 3] = 255
      feature.screen[(this.y + this.height - 1) * feature.screenWidth * 3 + (this.x + i) * 3] = 255
    }

    // vertical lines
    for (let i = 0; i < this.height; i++) {
      feature.screen[(this.y + i) * feature.screenWidth * 3 + this.x * 3] = 255
      feature.screen[(this.y + i) * feature.screenWidth * 3 + (this.x + this.width - 1) * 3] = 255
    }
  }
}

let distance, playing, ground, Y, V, W;

const reset = ()=>
{
    Y = 0;
    W = 22;
    distance = V = 0;
    playing = 1;
}

feature.on('start', e=> 
{
    reset();
});

feature.on('frame', e=> 
{
    clearScreen();
    playing && ++distance;

    // draw ground
    for (let i=5; i--;)
    {
        const j = i+distance/W|0;
        setDrawColorHSLA(j/29);
        const g = 47-Math.cos(j*j)*15|0;
        drawRectOutline(j*W-distance-7, g, W-3, 1e4);
        i && (ground=g);
    }

    // sub step physics
    for (let i=2; i--;)
    {
        Y -= V -= .06;
        if (Y > ground)
        {
            // check for safe landing
            V = 0;
            Y < ground+3 ? Y = ground : playing = 0;
        }
    }

    // draw player
    setDrawColorHSLA(distance/50, 1, .7);
    drawRect(9, Y-9, 6, 9);

    // draw score
    setDrawColorHSLA(0, 0, 1);
    drawNumber(distance/W|0, 24, 0);
});

feature.on('keys', e=>
{
    // jump
    if (e.keys.a)
        Y-ground || (V=2);
    if (e.keys.b)
        reset();
}

setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)
